/*----------------------------------------------------------------------
 *
 * SET: commit
 *
 *---------------------------------------------------------------------*/
/**
 * @internal
 * commit the values
 */
int
_mfd_ciscoLS1010ModuleTable_commit(netsnmp_mib_handler *handler,
                         netsnmp_handler_registration *reginfo,
                         netsnmp_agent_request_info *agtreq_info,
                         netsnmp_request_info *requests)
{
    int                    rc;
    ciscoLS1010ModuleTable_rowreq_ctx *rowreq_ctx = (ciscoLS1010ModuleTable_rowreq_ctx*)
                  netsnmp_container_table_row_extract(requests);

    DEBUGMSGTL(("internal:ciscoLS1010ModuleTable:_mfd_ciscoLS1010ModuleTable_commit","called\n"));

    netsnmp_assert(NULL != rowreq_ctx);
    
    rc = ciscoLS1010ModuleTable_commit(rowreq_ctx);
    if (MFD_SUCCESS != rc) {
        DEBUGMSGTL(("ciscoLS1010ModuleTable:mfd","error %d from "
                    "ciscoLS1010ModuleTable_commit\n", rc));
        netsnmp_request_set_error_all(requests, SNMP_VALIDATE_ERR(rc));
    }

    if (rowreq_ctx->rowreq_flags & MFD_ROW_DIRTY) {
        /*
         * if we successfully commited this row, set the dirty flag. Use the
         * current value + 1 (i.e. dirty = # rows changed).
         * this is checked in post_request...
         */
        ciscoLS1010ModuleTable_dirty_set( ciscoLS1010ModuleTable_dirty_get() + 1 ); /* set table dirty flag */
    }

    return SNMP_ERR_NOERROR;
}

int
_mfd_ciscoLS1010ModuleTable_undo_commit(netsnmp_mib_handler *handler,
                         netsnmp_handler_registration *reginfo,
                         netsnmp_agent_request_info *agtreq_info,
                         netsnmp_request_info *requests)
{
    int                    rc;
    ciscoLS1010ModuleTable_rowreq_ctx *rowreq_ctx = (ciscoLS1010ModuleTable_rowreq_ctx*)
                  netsnmp_container_table_row_extract(requests);

    DEBUGMSGTL(("internal:ciscoLS1010ModuleTable:_mfd_ciscoLS1010ModuleTable_undo_commit","called\n"));

    netsnmp_assert(NULL != rowreq_ctx);

    if (rowreq_ctx->rowreq_flags & MFD_ROW_DIRTY) {
        u_int  d = ciscoLS1010ModuleTable_dirty_get();

        netsnmp_assert(d != 0);
        if(d)
            ciscoLS1010ModuleTable_dirty_set( d - 1 );
    }

    rc = ciscoLS1010ModuleTable_undo_commit(rowreq_ctx);
    if (MFD_SUCCESS != rc) {
        /*
         * nothing we can do about it but log it
         */
        DEBUGMSGTL(("ciscoLS1010ModuleTable:mfd","error %d from "
                    "ciscoLS1010ModuleTable_undo_commit\n", rc));
    }

    if (rowreq_ctx->rowreq_flags & MFD_ROW_DIRTY) {
        snmp_log(LOG_WARNING, "ciscoLS1010ModuleTable row dirty flag still set after undo_commit\n");
        rowreq_ctx->rowreq_flags &= ~MFD_ROW_DIRTY;
    }

    return SNMP_ERR_NOERROR;
} /* _mfd_ciscoLS1010ModuleTable_commit */

